/** @format */

import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
	return (
		<div className='header'>
			<nav>
				<ul>
					{/* <div className='closed'>
						<Close className='close' />
					</div> */}

					<li>
						<Link to='/'></Link>
					</li>
				</ul>
			</nav>
		</div>
	);
};

export default Header;
